  input: '"TEXT","F3XN","C00034033","1. The SCGOP is using the following best effort
    to obtain identification of all individuals who contribute in excess of $200.  Our
    original solicitation includes a clear and conspicuous request for this information
    which includes the requirements of the federal law to provide such information.  If
    the information is not provided, we make a follow up effort per phone.  If the
    needed information is still not provided, we search the internet to obtain the
    information.  If we receive additional information we are either making an amendment
    for the period in question or add a memo stating the changes with our next filing.  2.
    The following additional information which effect prior filing was obtained:  Richard
    Bond, Dental Wellness Clinic, Dentist; Charles Bundy, retired, retired; Anthony
    Page, self employed, Real Estate Developer; Mac Harley, Scott & Stringfellow,
    Stock Broker; Manuel Peralta, retired, retired; Barbara Roberts, retired, retired;
    Nancy Beal, Home Maker, Home Maker; Roy Lindsey, Michelin Tire Co, Maintenance
    Technician.  3.  The disbursement on Schedule B for reimbursement for health insurance
    was to an employee who is NOT spending more than 25% of his time on Federal Election
    Activities. 4. The disbursements for net pay and payroll taxes on Schedule B was
    for employees who did NOT spend 25% or more of their time on Federal Election
    Activities. 5. The disbursement of $ 1075 to our State account was for a deposit
    which was erroneously deposited into our federal account instead of our state
    account.  6. The disbursement to Starboard for $ 3663 was for our update, the
    disbursement for $ 62.06  and the disbursement on Schedule H4 for $ 1170 was for
    invitations to the 2005 Victory Kick-off.  These communications did not promote,
    support, attack or oppose any candidate for Federal office and did not meet the
    definition of Federal Election Activity under 11 CFR 100.24."'
